import React from "react"

function NovaProjekcija(props){

    const opt=props.filmovi.map(f => <option key={f.id} value={f.id}>{f.naziv}</option>)

    return(
        <form onSubmit={props.handleSubmit}>
            <label>
                <select onChange={props.handleChange} name="film" value={props.state.film}>
                    <option value="">--Izaberi film--</option>
                    {opt}
                </select>
            </label>
            <br/>
            <input onChange={props.handleChange} type="datetime-local" name="datumVremePrikazivanje"/>
            <br/>
            <button type="submit">Dodaj</button>
        </form>
    )
}

export default NovaProjekcija
